    if (!this.surface) return;
    await this.surface.ready;

    const labelTexts = [
      'immediate',
      'linear',
      'easeInQuad',
      'easeOutQuad',
      'easeInOutQuad',
      'easeInCubic',
      'easeOutCubic',
      'easeInOutCubic',
      'easeInQuart',
      'easeOutQuart',
      'easeInOutQuart',
      'easeInQuint',
      'easeOutQuint',
      'easeOutElastic',
      'easeBackIn',
      'easeBackOut',
      'easeBackInOut',
      'continuousSinusoidal',
    ];

    for (let i = 0; i < 18; i++) {
      this.rectangles.push(
        new RectangleInstance({
          position: [
            window.innerWidth * 0.05,
            window.innerHeight * i / 18 +
              window.innerHeight / 36 +
              window.innerHeight / 100,
          ],
          size: [10, 10],
          color: [1, 1, 1, 1],
        })
      );

      this.followingRectangles.push(
        new RectangleInstance({
          position: [
            window.innerWidth * 0.05,
            window.innerHeight * i / 18 +
              window.innerHeight / 36 +
              window.innerHeight / 100,
          ],
          size: [10, 10],
          color: [1, 1, 1, 0.3],
        })
      );

      this.providers.labels.add(
        new LabelInstance({
          origin: [
            window.innerWidth * 0.05,
            window.innerHeight * i / 18 + window.innerHeight / 100,
          ],
          fontSize: 20,
          text: labelTexts[i],
          color: [1, 1, 1, 1],
        })
      );

      this.providers.lines.add(
        new EdgeInstance({
          start: [
            window.innerWidth * 0.05,
            window.innerHeight * i / 18 + window.innerHeight / 100,
          ],
          end: [
            window.innerWidth * 0.86,
            window.innerHeight * i / 18 + window.innerHeight / 100,
          ],
          startColor: [1, 1, 1, 1],
          endColor: [1, 1, 1, 1],
        })
      );
    }

    this.addRectanglesToProvider();

    setTimeout(() => {
      this.rectangles.forEach(
        rec => (rec.position = [window.innerWidth * 0.85, rec.position[1]])
      );
    }, 100);

    setTimeout(() => {
      this.followingRectangles.forEach(
        rec => (rec.position = [window.innerWidth * 0.85, rec.position[1]])
      );
    }, 1500);
